<!DOCTYPE html>
<html>
<head>
<title>Data viewer loading...</title>
<script src="https://linkeddata.github.io/tabulator/js/mashup/mahlib.js"/>
<link rel="stylesheet" href="https://linkeddata.github.io/tabulator/tabbedtab.css">
<script>
document.addEventListener('DOMContentLoaded', function() {
    tabulator.scriptBase = 'https://linkeddata.github.io/tabulator/'
    $rdf.Fetcher.crossSiteProxyTemplate = 'https://databox.me/,proxy?uri={uri}'
    var uri = window.location.href
    tabulator.outline.GotoSubject($rdf.sym(uri), true, undefined, true)
});
</script>
</head>
<body>
<!-- below to make outline code to put stuff -->
<div class="TabulatorOutline" id="DummyUUID">
  <table id="outline"></table>
</div>
</body>
</html>
